import React from 'react';
import { RadarChart, PolarGrid, PolarAngleAxis, PolarRadiusAxis, Radar, ResponsiveContainer } from 'recharts';
import { getAllCategories } from '../data/questions';

const Results = ({ results }) => {
  // Transform results for radar chart
  const chartData = getAllCategories().map(category => ({
    category: category.replace(' & ', '\n& '), // Line break for better display
    score: results[category] || 0,
    fullMark: 18 // Maximum possible score (6 questions × 3 points)
  }));

  // Calculate percentile scores (transform -18 to +18 range to 0-100)
  const getPercentileScore = (score) => {
    return Math.round(((score + 18) / 36) * 100);
  };

  // Get interpretation of score
  const getScoreInterpretation = (score) => {
    const percentile = getPercentileScore(score);
    if (percentile >= 80) return 'Very Strong';
    if (percentile >= 60) return 'Strong';
    if (percentile >= 40) return 'Average';
    if (percentile >= 20) return 'Below Average';
    return 'Needs Development';
  };

  // Get color based on score
  const getScoreColor = (score) => {
    const percentile = getPercentileScore(score);
    if (percentile >= 80) return '#059669'; // Dark green
    if (percentile >= 60) return '#065f46'; // Forest green
    if (percentile >= 40) return '#92400e'; // Dark amber
    if (percentile >= 20) return '#9a3412'; // Dark orange
    return '#7f1d1d'; // Dark red
  };

  return (
    <div className="container">
      <div className="card results-container">
        <h2>Your EFlo Profile</h2>
        <p style={{ color: '#6b7280', marginBottom: '32px', fontSize: '17px' }}>
          Your personalized insights across nine executive functioning domains
        </p>

        <div className="radar-chart-container">
          <ResponsiveContainer width="100%" height={500}>
            <RadarChart cx="50%" cy="50%" outerRadius="80%" data={chartData}>
              <PolarGrid />
              <PolarAngleAxis 
                dataKey="category" 
                tick={{ fontSize: 12, fill: '#4A5568' }}
                className="radar-labels"
              />
              <PolarRadiusAxis 
                angle={90} 
                domain={[-18, 18]} 
                tick={{ fontSize: 10, fill: '#718096' }}
              />
              <Radar
                name="Score"
                dataKey="score"
                stroke="#6366f1"
                fill="#6366f1"
                fillOpacity={0.2}
                strokeWidth={2}
              />
            </RadarChart>
          </ResponsiveContainer>
        </div>

        <div className="category-scores">
          {getAllCategories().map(category => {
            const score = results[category] || 0;
            const percentile = getPercentileScore(score);
            const interpretation = getScoreInterpretation(score);
            const color = getScoreColor(score);

            return (
              <div key={category} className="category-card">
                <h3>{category}</h3>
                <div className="score" style={{ color }}>
                  {percentile}%
                </div>
                <div style={{ 
                  fontSize: '14px', 
                  color: '#718096', 
                  marginTop: '4px' 
                }}>
                  {interpretation}
                </div>
                <div style={{ 
                  fontSize: '12px', 
                  color: '#A0AEC0', 
                  marginTop: '8px' 
                }}>
                  Raw Score: {score > 0 ? '+' : ''}{score}
                </div>
              </div>
            );
          })}
        </div>

        <div style={{ 
          marginTop: '48px', 
          padding: '32px', 
          backgroundColor: '#f9fafb', 
          borderRadius: '8px',
          textAlign: 'left',
          border: '1px solid #f3f4f6'
        }}>
          <h3 style={{ marginBottom: '20px', color: '#1f2937', fontSize: '18px', fontWeight: '500' }}>Understanding Your Results</h3>
          <p style={{ lineHeight: '1.7', color: '#4b5563', marginBottom: '16px' }}>
            <strong>Score Interpretations:</strong>
          </p>
          <ul style={{ lineHeight: '1.8', color: '#6b7280', paddingLeft: '20px', marginBottom: '20px' }}>
            <li><strong>80-100%:</strong> Very Strong - Excellent functioning in this domain</li>
            <li><strong>60-79%:</strong> Strong - Good functioning with room for growth</li>
            <li><strong>40-59%:</strong> Average - Typical functioning abilities</li>
            <li><strong>20-39%:</strong> Developing - Some areas that may benefit from attention</li>
            <li><strong>0-19%:</strong> Growing - Opportunities for skill development</li>
          </ul>
          <p style={{ lineHeight: '1.7', color: '#6b7280', fontSize: '15px' }}>
            This assessment provides insights for personal growth and self-awareness. 
            For comprehensive evaluation or concerns, consider consulting with a qualified professional.
          </p>
        </div>

        <button 
          className="btn btn-primary" 
          onClick={() => window.location.reload()}
          style={{ marginTop: '30px' }}
        >
          Take Test Again
        </button>
      </div>
    </div>
  );
};

export default Results;
